import react from 'react';

function tick(){
    const element = (
        <div>
            <h1>현재 시간 : {new Date().toLocaleTimeString()}</h1>
        </div>
    );

    ReactDOM.render(element, document,getElementsById('root'));
}

setInterval(tick, 1000);

export default Time;
